import React, {Fragment} from 'react';
import CardList from './components/CardList';
import { robots } from './components/robots';
import SearchBox from './components/SearchBox'

const App = () => {
return (
    <Fragment>
        <h1>RoboFriends</h1>
        <SearchBox />
        <CardList robots={robots}/>
    </Fragment>
    );
}
export default App;
